import React, {Component} from 'react';
class Search extends Component {
  state = {
    try: [
      {
        test: 'something new',
        test1: 'react'

      }, {
        test: 'something old',
        test1: 'angular'
      }
    ]
  }
  render() {
    const options = this.state.try.map((item, index) => <li key={index}>{`${item.test} in ${item.test1}`}</li>)
    return (<ul>
      {options}
    </ul>);
  }
}
export default Search;
